B.aIg=A.a(s([';BOLD[[CGRN[["Ma\u0161ina, kurios mas\u0117 700 kg i\u0161 vietos pradeda greit\u0117dama va\u017eiuoti, kol pasiekia 72 km/h greit\u012f. Ma\u0161ina, tolygiai greit\u0117dama iki \u0161io grei\u010dio, va\u017eiavo 16 sekund\u017ei\u0173.\nKokia va\u017eiuojan\u010dios ma\u0161inos j\u0117ga?"]]]]|N_2|',";Pirmiausia suprantame, jog BOLD[[tai mechanikos/jud\u0117jimo u\u017edavinys]], tod\u0117l reik\u0117s naudotis tos srities formul\u0117mis.",";BOLD[[Susira\u0161ome kas duota ir k\u0105 reikia rasti.]] Kadangi pasakyta, jog k\u016bnas pajuda i\u0161 rimties b\u016bsenos, turime dar vien\u0105 neduot\u0105 dyd\u012f - pradin\u012f greit\u012f vDFLT[[\u2080]] = 0 km/h.",";BOLD[[Visus vienetus paver\u010diame \u012f SI sistemos vienetus:]] kilometrus per valand\u0105 (km/h) paver\u010diame \u012f metrus per sekund\u0119 (m/s).",";BOLD[[\u017dinome ne vien\u0105 j\u0117gos F formul\u0119]], XBLD[[ta\u010diau viena t\u0117ra kuri susijusi su jud\u0117jimu: F=ma]].\nCBLU[[Matome, jog taip pat turime duot\u0105 mas\u0119, taigi \u0161i formul\u0117 tikriausiai tiks.]]\nBOLD[[Neturime duoto pagrei\u010dio, ta\u010diau turime toje formul\u0117je nesan\u010di\u0173 dyd\u017ei\u0173]]: greit\u012f, pradin\u012f greit\u012f ir laik\u0105. CBLU[[\u017dinome formul\u0119, kuri apima visus pamin\u0117tus dyd\u017eius]]: a=(v-vDFLT[[\u2080]])/t.\nTaigi, dabar galime rasti neturim\u0105 pagreit\u012f ir tada j\u012f panaudoti su mase skai\u010diuojant j\u0117g\u0105.",";Pagal pagrei\u010dio formul\u0119 a=(v-vDFLT[[\u2080]])/t apskai\u010diuojame pagreit\u012f.\nDabar, tur\u0117dami ir pagreit\u012f, ir mas\u0119, apskai\u010diuojame ie\u0161kom\u0105 j\u0117g\u0105 formule F=ma."]),t.s)
