B.aIh=A.a(s([";XBLD[[Paverskime 1.2 kilovatvalandes \u012f vatsekundes (d\u017eiaulius):]]",";CBLU[[\u017dinome, jog vienas kilovatas 1kW = 1000W.]]\nTaigi, BOLD[[1kW/1000W ir 1000W/1kW yra lygu 1]].",";CBLU[[Taip pat, viena valanda 1h = 3600s.]]\nTaigi, BOLD[[1h/3600s ir 3600s/1h yra lygu 1]].",";Mums i\u0161 turim\u0173 1.2 kWh reikia i\u0161prastinti kilovatus (kW) ir taip gauti likusius vatus (W) bei i\u0161prastinti valandas (h) ir gauti likusias sekundes (s).",";BOLD[[Pirmiausia kilovatus pakeiskime vatais:]]\nKadangi CBLU[[kilovatai yra vir\u0161uje]], kitoje trupmenoje CBLU[[jie turi b\u016bti apa\u010dioje]]. CBLU[[Vir\u0161uje lieka 1000W]]:\nVadinasi, XBLD[[dauginame i\u0161 1000W/1kW]]:",";1,2CROS[[kW]]h \u22c5 1000W/1CROS[[kW]] = 1,2h \u22c5 1000W =\n1,2 \u22c5 1000 Wh = 1200 Wh",";BOLD[[Tada pakeiskime valandas sekund\u0117mis:]]\nKadangi CBLU[[valandos taip pat vir\u0161uje]], kitoje trupmenoje CBLU[[jos turi b\u016bti apa\u010dioje]]. CBLU[[Vir\u0161uje lieka 3600s]]:\nVadinasi, XBLD[[dauginame i\u0161 3600s/1h]]:",";1200WCROS[[h]] \u22c5 3600s/1CROS[[h]] = 1200W \u22c5 3600s =\n1200 \u22c5 3600 Ws = 4320000 Ws",";Kadangi 1 vatas yra d\u017eiaulis dalintas i\u0161 sekund\u0117s (W = J/s), CBLU[[1 d\u017eiaulis yra vatas padaugintas i\u0161 sekund\u0117s (J = Ws)]], arba kitaip, BOLD[[yra vienas ir tas pats kaip vatsekund\u0117]]:",";CBLU[[1,2kWh = 4320000Ws = 4320000J]]"]),t.s)
