B.aFr=A.a(s(["Jie naudojami technikoje ir buityje, kai reikia pakeisti j\u0117gos krypt\u012f (nekilnojamuoju svertu) ar laim\u0117ti j\u0117gos (kilnuojamuoju svertu), t. y. ma\u017eesne j\u0117ga atsverti didesn\u0119. Kilnuojamuoju svertu laimima j\u0117gos taikant CBLU[[j\u0117gos moment\u0173 taisykl\u0119]].","Sverto principu pagr\u012fstas viniatraukio, \u017enypli\u0173, atkim\u0161tuko, spaustuko, svarstykli\u0173, \u0161ulini\u0173 svir\u010di\u0173 bei suktuv\u0173, ver\u017eliarak\u010di\u0173 ir kt. veikimas. Svert\u0173 yra daugelyje ma\u0161in\u0173 ir \u012frengini\u0173, pavyzd\u017eiui, dviratyje, treniruoklyje, automobilyje, ekskavatoriuje, karu\u010diuose. J\u0173 turi ir \u017emogus, gyv\u016bnai bei augalai (pvz. ranka, \u017eandikaulis)."]),t.s)
