B.aGO=A.a(s(["BOLD[[1. ]];Pirmiausia, BOLD[[gave u\u017edavin\u012f, gerai ir atid\u017eiai j\u012f perskaitykite vien\u0105 ar kelis kartus]] pagal poreik\u012f, XBLD[[kol pilnai suprasite apie k\u0105 jame ra\u0161oma]], kas po ko vyksta ir ko reikia ie\u0161koti. Jei tai jud\u0117jimo, mechanikos u\u017edavinys arba jau\u010diate, jog su br\u0117\u017einiu jums bus lengviau j\u012f suprasti ir i\u0161spr\u0119sti - BOLD[[nusibr\u0117\u017ekite br\u0117\u017ein\u012f ar grafik\u0105]]. Jie padeda geriau suprasti nurodyt\u0105 situacij\u0105 ir nepasimesti skai\u010diuojant.|N_2|","BOLD[[2. ]];Suprat\u0119 u\u017edavinio esm\u0119, XBLD[[u\u017esira\u0161ykite visk\u0105, kas duota u\u017edavinio salygoje ir k\u0105 reikia rasti]]. Ra\u0161ykite dyd\u017ei\u0173 \u017eym\u0117jimus pagal standartus, BOLD[[reik\u0161mi\u0173 vertes paverskite \u012f SI sistemos vienetus]] jei jie tokie n\u0117ra. Jei yra CBLU[[keli tokie patys dyd\u017eiai, atskirkite juos indeksais, \u017eym\u0117dami juos sistemati\u0161kai]]. Jei nusibr\u0117\u017e\u0117te grafik\u0105 ar br\u0117\u017ein\u012f, dyd\u017ei\u0173 (j\u0173 simboli\u0173 ar/ir ver\u010di\u0173) sura\u0161ymas pad\u0117s jums dar ai\u0161kiau suprasti duot\u0105 situacij\u0105. Jei duota, kad du dyd\u017eiai lyg\u016bs arba proporcingi ir pan., taip pat tai u\u017esira\u0161ykite.|N_2|","BOLD[[3. ]];BOLD[[Atkreipkite d\u0117mes\u012f \u012f ie\u0161kom\u0105 dyd\u012f/dyd\u017eius.]] XBLD[[Prisiminkite arba raskite formules, kuriose yra tas dydis.]] Pagalvokite, kokio tipo u\u017edavin\u012f sprend\u017eiate ir pagal tai - kokios formul\u0117s logi\u0161kai atitikt\u0173. BOLD[[Tinkamo konteksto formules u\u017esira\u0161ykite.]]\nBOLD[[Pvz.:]] Jei sprend\u017eiate u\u017edavin\u012f apie judan\u010di\u0105 ma\u0161in\u0105, grei\u010dio turb\u016bt ie\u0161kosite mechanikoje ir jud\u0117jime, ne formul\u0117se apie bang\u0173 arba \u0161viesos greit\u012f.|N_2|","BOLD[[4. ]];BOLD[[Pa\u017ei\u016br\u0117kite \u012f formules. Ar turite visus dyd\u017eius kurie yra formul\u0117je?:]]|N_1|","     1. ;BOLD[[CGRN[[Jei taip, \u0161aunu!]]]] Belieka (jei reikia) i\u0161reik\u0161ti ie\u0161kom\u0105 dyd\u012f i\u0161 formul\u0117s, \u012fstatyti dyd\u017eius ir apskai\u010diuoti.|N_1|","     2. ;BOLD[[CGRN[[Jei ne]]]], BOLD[[turb\u016bt turite dyd\u017ei\u0173, kuri\u0173 toje formul\u0117je n\u0117ra]]. CBLU[[Tada pa\u017ei\u016br\u0117kite koki\u0173 atliekam\u0173 dyd\u017ei\u0173 turite, ir raskite formul\u0119, kuri apimt\u0173 juos.]] Tada turite u\u017edavin\u012f, kur reikia atlikti kelis veiksmus vienas po kito.\nBOLD[[Pvz.:]] Ie\u0161kote k\u016bn\u0105 veikian\u010dios j\u0117gos F. Turite to k\u016bno pagreit\u012f a, jo tank\u012f \u03c1 ir tur\u012f V. \u017dinote, kad j\u0117gos formul\u0117 F=ma. Neturite mas\u0117s. Ta\u010diau \u017einote, jog mas\u0117 turi ir kit\u0105 formul\u0119: m=\u03c1V. Dabar galite apskai\u010diuoti mas\u0119 pagal \u0161it\u0105 formul\u0119, o tada jos ir pagrei\u010dio reik\u0161mes \u012fstatyti \u012f F=ma.|N_1|",'     3. ;BOLD[[CGRN[[Jei neturite daugiau dyd\u017ei\u0173 ir j\u0173 tr\u016bksta]], dar kart\u0105 perskaitykite u\u017edavin\u012f]]. Gal kai kurie dyd\u017eiai (konstantos) yra nurodyti knygos ar s\u0105siuvinio gale.\nBOLD[[Pagalvokite logi\u0161kai, gal u\u017edavinyje dydis pasakytas.]]\nBOLD[[Pvz:]] Para\u0161yta, jog "K\u016bnas i\u0161 rimties b\u016bsenos pradeda jud\u0117ti". Para\u0161yta jog jis stov\u0117jo vietoje nejud\u0117damas ir prad\u0117jo jud\u0117ti. Taigi jo pradinis greitis vDFLT[[\u2080]]=0 m/s, nors tiesiogiai \u0161i reik\u0161m\u0117 pasakyta nebuvo.|N_1|',"     4. ;BOLD[[CGRN[[Jei vis tiek tr\u016bksta dyd\u017ei\u0173, galb\u016bt pasirinkote ne t\u0105 formul\u0119.]]]]\nBOLD[[Pvz.:]] Jums reikia rasti k\u016bno jud\u0117jimo greit\u012f, o turite jo pagreit\u012f a, pradin\u012f greit\u012f vDFLT[[\u2080]] ir jud\u0117jimo laik\u0105 t. Nusprend\u0117te naudoti formul\u0119 s=vt, bet n\u0117ra nurodytas kelias. Ta\u010diau yra dar viena formul\u0117 a=(v-vDFLT[[\u2080]])/t, kuri apima visus duotus dyd\u017eius. Taigi, reikia naudoti b\u016btent \u0161i\u0105 formul\u0119.|N_2|","XBLD[[5. ]];XBLD[[Gav\u0119 atsakym\u0105 pasitikrinkite, ar teisingais vienetais j\u012f gavote.]] Naudokite tik SI sistemos vienetus. Atkreipkite d\u0117mes\u012f, ar u\u017eduotis reikalauja duot\u0105 atsakym\u0105 paversti kitais vienetais.|N_2|","XBLD[[6. ]];XBLD[[Pagalvokite, ar j\u016bs\u0173 gautas atsakymas logi\u0161kas.]]\nBOLD[[Pvz.:]] Jei skai\u010diavote ma\u0161inos greit\u012f automagistral\u0117je, turb\u016bt nelogi\u0161ka jei ji va\u017eiuoja 10km/h arba 500km/h grei\u010diu.|N_2|"]),t.s)
