B.aI6=A.a(s([";BOLD[[Lempinio generatoriaus veikimas:]]","1. ;Virpesi\u0173 kont\u016bras gamina auk\u0161to da\u017enio slopinamuosius elektromagnetinius virpesius.","2. ;Virpesi\u0173 kont\u016bro rit\u0117s LTXT[[L_a]] kintamasis magnetinis laukas indukuoja rit\u0117je LTXT[[L_t]], sujungtoje su triodo tinkleliu, kintam\u0105j\u0105 elektrovar\u0105, kuri yra tokio pat da\u017enio.","3. ;Tarp vakuuminio triodo tinklelio bei katodo (dalis, prijungta prie baterijos LTXT[[B_k]]), kurie sujungti su rite LTXT[[L_t]], susidaro kintamasis elektrinis laukas.","4. ;Susidar\u0119s kintamasis laukas valdo per vakuumin\u012f triod\u0105 tekan\u010di\u0105 elektros srov\u0119 \u012f virpesi\u0173 kont\u016br\u0105, atlikdamas jungiklio funkcij\u0105 (tai \u012fsijungia, tai i\u0161sijungia, nes vienu atveju srov\u0117s kryptis vienokia, kitu atveju prie\u0161inga - prisiminkite triodo veikimo princip\u0105).","5. ;Vakuuminis triodas kiekvien\u0105 period\u0105 reikiamu momentu sujungia anodo srov\u0117s \u0161altin\u012f LTXT[[B_a]] su virpesi\u0173 kont\u016bru (sukuria u\u017edar\u0105 grandin\u0119 ir praleid\u017eia srov\u0119) ir taip papildo kont\u016bro energij\u0105.","6. ;Ilgainiui nusistovi toks virpesi\u0173 r\u0117\u017eimas, kai energijos nuostolius virpesi\u0173 kont\u016bre kompensuoja anodos srov\u0117s \u0161altinio LTXT[[B_a]] energija. CBLU[[Grandin\u0117je vyksta neslopinamieji virpesiai]]."]),t.s)
