B.aGt=A.a(s(["BOLD[[Garso greitis ore pirm\u0105 kart\u0105 buvo i\u0161matuotas apie 1640 metus G. Galil\u0117jaus pasi\u016blytu metodu.]] Vienas \u017emogus atsistojo tam tikru \u017einomu atstumu nuo patrankos, o jo pagalbininkas \u0161ov\u0117 i\u0161 tos patrankos. I\u0161matavus laik\u0105 tarp \u0161viesos blykstel\u0117jimo momento bei garso pri\u0117mimo momento ir padalijus i\u0161 jo atstum\u0105 iki patrankos, CBLU[[gautas apytikslis rezultatas \u2014 daugiau kaip 300m/s]].","BOLD[[Pakankamai tikslius garso grei\u010dio matavimo rezultatus 1822 metais gavo Pranc\u016bzijos ilgum\u0173 biuro nariai.]] Dvi patrankas buvo pastatytos 18613m atstumu vien\u0105 nuo kitos ir, pasidalijus \u012f dvi grupes, buvo \u0161audoma paeiliui i\u0161 kiekvienos patrankos kas 5 minutes, kad rezultatams netur\u0117t\u0173 \u012ftakos v\u0117jas. Mokslininkai nustat\u0117, jog pasirinkt\u0105 atstum\u0105 garsas nusklinda per 54,6s. CBLU[[Taigi garso greitis v=s/t; v = 18613m/54,6s \u2248 340,9 m/s.]]","BOLD[[Garsas sklinda ne tik oru, bet ir vandeniu. Tai patvirtino 1827 metais \u017denevos e\u017eere atlikti bandymai.]] Du laiveliai buvo i\u0161d\u0117styti 13365m atstumu vienas nuo kito. Viename laivelyje s\u0117dintis tyr\u0117jas u\u017edegdavo parak\u0105 ir tuo pat metu paskambindavo povandeniniu varpu. Kitame laivelyje esantis eksperimentuotojas po 9s i\u0161girsdavo varpo gars\u0105 pro \u012fmerkt\u0105 \u012f vanden\u012f klausom\u0105j\u012f rag\u0105. Apskai\u010diavus paai\u0161k\u0117jo, kad CBLU[[\u017denevos e\u017eere garsas sklinda 1485 m/s grei\u010diu]]."]),t.s)
