B.aH9=A.a(s([";XBLD[[Panagrin\u0117kime, kaip veikia virpesi\u0173 kont\u016bras:]]","1. ;BOLD[[Periodo prad\u017eioje (LTXT[[t = 0]]; 1 pav.)]] srov\u0117 kont\u016bru neteka LTXT[[(I = 0)]], o \u012felektrinto kondensatoriaus kr\u016bvis yra did\u017eiausias LTXT[[q_{max}]].","2. ;BOLD[[Per pirm\u0105j\u012f periodo ketvirt\u012f (LTXT[[0 \\le t \\le \\frac{1}{4}T]]; 2 pav.)]] kondensatorius laipsni\u0161kai i\u0161sikrauna ir i\u0161 teigiamai \u012felektrintos jo plok\u0161tel\u0117s \u012f neigiamai \u012felektrint\u0105 plok\u0161tel\u0119 rite ima teketi stipr\u0117janti elektros srov\u0117, kuri \u0161ios periodo dalies pabaigoje \u012fgyja didziausi\u0105 vert\u0119 LTXT[[(I_m)]].","    \u2022 ;Toji i\u0161krovos srov\u0117 sustipr\u0117ja ne akimirksniu, nes jai trukdo d\u0117l saviindukcijos rit\u0117je atsiradusi prie\u0161ingos krypties srov\u0117.","    \u2022 ;Kai kondensatorius i\u0161sikrauna iki galo, visa jo elektrinio lauko energija virsta rit\u0117s magnetinio lauko energija.","3. ;BOLD[[Per antr\u0105j\u012f periodo ketvirt\u012f (LTXT[[\\frac{1}{4}T \\lt t \\le \\frac{1}{2}T]]; 3 pav.)]] elektros srov\u0117 i\u0161 karto nenutr\u016bksta, bet toliau teka silpn\u0117dama, mat j\u0105 palaiko rit\u0117je atsiradusi saviindukcin\u0117 elektrovara. Indukuotoji srov\u0117 \u012fkrauna kondensatori\u0173 prie\u0161inga kryptimi (prie\u0161ingo \u017eenklo kr\u016bviais).","    \u2022 ;Periodo antrojo ketvir\u010dio pabaigoje srov\u0117s stipris v\u0117l pasidaro lygus nuliui, kondensatorius visi\u0161kai \u012fsikrauna, o visa virpesi\u0173 kont\u016bro energija susikaupia tarp kondensatoriaus plok\u0161teli\u0173.","    \u2022 ;Taigi rit\u0117s magnetinio lauko energija v\u0117l virsta kondensatoriaus elektrinio lauko energija. CBLU[[Ta\u010diau dabar \u0161io lauko j\u0117g\u0173 linij\u0173 kryptis yra prie\u0161inga pradinei kryp\u010diai.]]","4. ;Toliau procesas kartojasi, tik, i\u0161sielektrinant kondensatoriui, srov\u0117 teka kont\u016bru prie\u0161inga kryptimi (4 ir 5 pav.).","5. ;I\u0161 5 paveikslo matyti, kad, pasibaigus vienam periodui, kondensatorius \u012fsikrauna taip pat, kaip buvo i\u0161 prad\u017ei\u0173, vadinasi, toliau procesas kartojasi ta pa\u010dia tvarka. CBLU[[Taigi matome, kad srov\u0117 teka kont\u016bru tai viena, tai kita kryptimi - ji svyruoja tam tikru da\u017eniu.]]"]),t.s)
