B.aDC=A.a(s([";CRED[[Prie\u0161 nagrind\u0117dami tranzistorius, susipa\u017einkite su puslaidininkiais diodais (elektriniais bei skyliniais laidumais, np sand\u016bromis), apra\u0161ytais temoje \u201eElektros srov\u0117 puslaidininkiuose\u201d.]]|N_6|",";BOLD[[Tranzistorius]] - puslaidininkis prietaisas, da\u017eniausiai atliekantis jungiklio funkcija. Jo veikimas labai pana\u0161us \u012f vakuuminio triodo.|N_4|",";BOLD[[Tranzisotri\u0173 sudaro 3 puslaidininki\u0173 sluoksniai (atskirti dviejomis sand\u016bromis):]]","\u2022 ;CBLU[[emiteris (E)]] (\u201espinduliuoja\u201d elektronus - i\u0161 jo elektronai teka link kit\u0173 dviej\u0173 sluoksni\u0173)","\u2022 ;CBLU[[baz\u0117 (B)]] (\u201epagrindas\u201d, ji kontroliuoja per tranzistori\u0173 tekan\u010di\u0105 srov\u0119)","\u2022 ;CBLU[[kolektorius (K)]] (\u201esurenka\u201d elektronus - \u012f j\u012f atiteka elektronai i\u0161 emiterio)|N_4|",";BOLD[[Emiteris ir kolektorius abu yra tokio pa\u010dio laidumo]] (n arba p tipo)BOLD[[, o baz\u0117 yra prie\u0161ingo laidumo]] (p, kai kiti du sluoksniai n laidumo; n, kai kiti du sluoksniai p laidumo).",";Emiteris bei kolektorius abu yra pana\u0161aus storumo, kai tuo tarpu baz\u0117s sluoksnis yra daug kart\u0173 plonesnis.|N_6|",";BOLD[[Tranzistori\u0173 tipai:]]","\u2022 ;CBLU[[npn tranzistorius]] - tranzistorius, kurio emiteris bei kolektorius yra n tipo (elektroninio laidumo), o baz\u0117 p tipo (skylinio laidumo)","\u2022 ;CBLU[[npn tranzistorius]] - tranzistorius, kurio emiteris bei kolektorius yra p tipo (skylinio laidumo), o baz\u0117 n tipo (elektroninio laidumo)|N_6|",";Srov\u0117, tekanti tranzistoriumi (kolektoriaus srov\u0117), reguliuojama kei\u010diant baz\u0117s srov\u0117s stipr\u012f, kuris b\u016bna daug ma\u017eesnis nei kolektoriaus srov\u0117. Taigi silpna baz\u0117s grandin\u0117s srove galima valdyti tranzistori\u0173 - stipri\u0105 kolektoriaus grandin\u0117s srov\u0119."]),t.s)
