B.aCl=A.a(s(["XBLD[[Nekilnojamasis skridinys]] - skridinys, u\u017emautas ant nejudan\u010dios a\u0161ies. Juo pakei\u010diama j\u0117gos veikimo kryptimis, j\u0117gos nelaimima.","XBLD[[Kilnojamasis skridinys]] - niekur ne\u012ftvirtintas (turi judan\u010di\u0105 a\u0161\u012f) skridinys, kylantis kartu su pasvarais. Juo dvigubai laimima j\u0117gos (bet dvigubai pralaimima kelio), j\u0117gos veikimo kryptis nesikei\u010dia.\nJuo laimima dvigubai j\u0117gos, nes \u0161is skridinys yra ne kas kita, o vienpusis svertas, nes j\u0117gos j\u012f veikia i\u0161 vienos atramos A pus\u0117s (2 pav.). Keliam\u0173 pasvar\u0173 svorio P petys lygus IDFLT[[\u2081]] k\u0117l\u0117jo j\u0117gos F petys yra I\u2082. Tod\u0117l nagrin\u0117jamo skridinio pusiausvyros s\u0105lyga tokia: PlDFLT[[\u2081]] = Fl\u2082. Ta\u010diau I\u2082 (jis lygus skridinio skersmeniui) du kartus ilgesnis u\u017e lDFLT[[\u2081]] (skridinio spindul\u012f). Vadinasi, F yra perpus ma\u017eesn\u0117 u\u017e P.","XBLD[[Skrystis]] - technikoje pla\u010diai naudojamas paprastasis mechanizmas. Tai krovini\u0173 k\u0117limo \u012frenginys, sudarytas i\u0161 kilnojam\u0173j\u0173 ir nekilnojam\u0173j\u0173 skridiniu, sujungt\u0173 lanks\u010dia traukle. Jei skrys\u010dius sudaro n kilnojam\u0173j\u0173 skridini\u0173, kroviniui pakelti reikia 2n kart\u0173 ma\u017eesn\u0117s j\u0117gos negu krovinio svoris."]),t.s)
