B.b6g=new A.bs("Vis\u0173 pirma, XBLD[[mums reikia perprasti de\u0161iniosios rankos taisykl\u0119]] (specifi\u0161kai - kai ranka apimamas laidininkas).\nJi teigia, jog BOLD[[jeigu de\u0161ine ranka apimsime laidinink\u0105 taip, kad i\u0161tiestas nyk\u0161tys rodyt\u0173 srov\u0117s krypt\u012f, tai lik\u0119 4 sulenkti pir\u0161tai rodys magnetinio lauko linij\u0173 krypt\u012f.]]\nTaigi, ja naudodamiesi gal\u0117sime rasti magnetinio lauko j\u0117g\u0173 linijas ir elektros srov\u0117s krypt\u012f u\u017edarame laidininke.",!1,16,null)
B.b6i=new A.bs("Kintamosios srov\u0117s generatori\u0173 b\u016bna \u012fvairi\u0173 konstrukcij\u0173, ta\u010diau juos visada sudaro laidininkai, kuriuos veria magnetinis srautas.|N_4|Panagrin\u0117kime papras\u010diausi\u0105 generatorio model\u012f - tarp magneto poli\u0173 sukam\u0105 vielin\u012f r\u0117mel\u012f:",!1,16,null)
B.b6j=new A.bs("Svarbiausia daugelio radiotechnini\u0173 itais\u0173 dalis yra \u012frenginys, kuriame sukeliami elektriniai virpesiai. Jis vadinamas BOLD[[virpesi\u0173 kont\u016bru]]. Tai grandin\u0117, sudaryta i\u0161 kondensatoriaus ir prie jo plok\u0161teli\u0173 prijungtos rit\u0117s.",!1,16,null)
B.b6k=new A.bs("BOLD[[Dyzeliniai varikliai]] veikia beveik taip pat, jie i\u0161 esm\u0117s skiriasi tik tuo, BOLD[[kad neturi u\u017edegimo \u017evak\u0117s]].|N_1|CBLU[[Cilindre susl\u0117gtas oras \u012fkaista iki 500\u2014 700 \xb0C. Nuo jo savaime suspaudimo takto pabaigoje u\u017esiliepsnoja dideliu sl\u0117giu \u012fpurk\u0161ti \u012f cilindr\u0105 degalai.]]",!1,16,null)
B.b6l=new A.bs("Praktikoje laidininkai retai jungiami grandin\u0117je vien nuosekliai arba vien lygiagre\u010diai. Toje pa\u010dioje grandin\u0117je da\u017enai derinamas lygiagretusis ir nuoseklusis laidinink\u0173 jungimas.",!1,16,null)
B.b6o=new A.bs("Virpesi\u0173 periodo formul\u0117 BOLD[[LTXT[[T=2 \u03c0 \\sqrt{LC}]] dar vadinama Tomsono formule]].",!1,16,null)
B.b6p=new A.bs("Ampermetras \u012f elektrin\u0119 grandin\u0119 XBLD[[jungiamas nuosekliai]] tam prietaisui, kurio stipris matuojamas.",!1,16,null)
B.b6q=new A.bs("Taigi, virpesi\u0173 kont\u016bras sukuria slopinamuosius elektromagnetinius virpesius, ta\u010diau CBLU[[praktikoje daug svarbesni neslopinamieji elektromagnetiniai virpesiai]].|N_2|Jiems gauti naudojamas prietaisas, vadinamas BOLD[[elektromagnetini\u0173 virpesi\u0173 generatoriumi]] - CBLU[[tai prietaisas, galintis papildyti virpesi\u0173 kont\u016br\u0105 energija, kuri yra prarandama d\u0117l laidinink\u0173 \u0161ilimo]] (papildantis tiek energijos, kiek jos yra prarandama).",!1,16,null)
B.b6s=new A.bs("CBLU[[Norint i\u0161spr\u0119sti bet kok\u012f fizikos u\u017edavin\u012f reik\u0117t\u0173 laikytis keli\u0173 pagrindini\u0173 praktik\u0173.]] Yra labai svarbu BOLD[[\u012fsiskaityti \u012f u\u017edavin\u012f ir suprasti, kas yra duota ir k\u0105 tiksliai reikia rasti.]] Taip pat atkreipti d\u0117mes\u012f \u012f duotus patarimus, patikslinimus ar netiesiogines reik\u0161mes.\nTaip pat, kaip ir daugelyje sri\u010di\u0173, BOLD[[svarbi praktika]]. CBLU[[Juo daugiau spresite pana\u0161i\u0173 u\u017edavini\u0173, juo geriau ir grei\u010diau gal\u0117site atpa\u017einti problem\u0105 ir sudaryti \u017eingsnius jai i\u0161spr\u0119sti.]]",!1,16,null)
B.b6t=new A.bs("Tranzistorinis generatorius neslopinamuosius virpesius generuoja analogi\u0161kai (beveik taip pat), kaip lempinis generatorius.\nTik \u0161iuo atveju vietoj vakuuminio triodo ir prie jo katodo prijungtos baterijos naudojamas tranzistorius. Jo baz\u0117 bei emiteris sujungiami su rite.",!1,16,null)
B.b6u=new A.bs("Kaip matote, svorio j\u0117gos br\u0117\u017einyje (auk\u0161\u010diau), sunkio ir svorio j\u0117gos ypa\u010d ry\u0161kiai skiriasi tada, BOLD[[kai k\u016bnas laisvai krinta pagrei\u010diu g]].|N_4|BOLD[[\u2022 ]]Tuomet CBLU[[sunkio j\u0117ga nepakinta]], tarsi k\u016bnas b\u016bt\u0173 rimties b\u016bsenos.\nBOLD[[\u2022 ]]CBLU[[Svoris pasidaro lygus nuliui]] \u2014 k\u016bnas nespaud\u017eia atramos ir netempia pakabos. K\u016bnas yra nesvarus.",!1,16,null)
B.b6v=new A.bs("XBLD[[Infragarsas:]] Da\u017enu atveju BOLD[[kenkia \u017emogui]], nes m\u016bs\u0173 ausys jo negirdi, ta\u010diau j\u012f jau\u010dia k\u016bnas. Sukelia nerim\u0105, baim\u0119, nuovarg\u012f. BOLD[[Ypa\u010d pavojingas 7-8 Hz garsas]], nes jis priver\u010dia vibruoti organus, sutampa su \u0161irdies bei smegen\u0173 savitaisiais da\u017eniais ir gali trikdyti \u0161i\u0173 organ\u0173 veikl\u0105. Gyv\u016bnai infragars\u0105 junta geriau nei \u017emon\u0117s, tod\u0117l naminiai gyv\u016bnai reaguoja audriai prie\u0161 prasidedant audroms ar art\u0117jant perk\u016bnijai.|N_2|BOLD[[J\u012f sukelia:]] autobusai, audros, \u017eem\u0117s dreb\u0117jimai, uraganai, sprogimai ir t.t.|N_4|XBLD[[Ultragarsas:]] BOLD[[D\u0117l ma\u017eo bangos ilgio gali sklisti siaurais pluo\u0161tais ir atsispind\u0117ti nuo ma\u017e\u0173 matmen\u0173 kli\u016b\u010di\u0173.]]|N_2|Naudojamas echolotuose, echoskopams gaminti. Ultragarsas pla\u010diai taikomas medicinoje ligoms diagnozuoti, v\u0117\u017eiui, s\u0105nari\u0173 u\u017edegimui, radikulitui gydyti, l\u016b\u017eusiems kaulams sujungti ir kt. Ultragarsu gali b\u016bti sterilizuojami maisto produktai, kartais jis naudojamas kaip s\u0117kl\u0173 dygimo, augal\u0173 augimo ir brendimo stimuliatorius.",!1,16,null)
B.b6y=new A.bs("Tam, kad rastume elektros srov\u0117s krypt\u012f, mums vis\u0173 pirma reikia \u017einoti BOLD[[t\u0105 elektros srov\u0119 su\u017eadinusio elektromagnetinio lauko j\u0117g\u0173 linij\u0173 krypt\u012f.]]\nJ\u0105 su\u017einosime naudodamiesi XBLD[[Lenco taisykle:]] BOLD[[jei magnetinis laukas, kuriame yra u\u017edaras laidininkas, stipr\u0117ja, indukuotoji srov\u0117 su\u017eadina prie\u0161ingos krypties magnetin\u012f lauk\u0105, jei silpn\u0117ja - tos pa\u010dios krypties lauk\u0105.]]:|N_10|",!1,16,null)
B.b6B=new A.bs("Reikia \u012fsid\u0117m\u0117ti, jog kroviniui pakelti nuo\u017eulni\u0105ja plok\u0161tuma reikia tiek kart\u0173 ma\u017eiau j\u0117gos, BOLD[[kiek kart\u0173 ta plok\u0161tuma k\u016bno nueitas kelias yra ilgesnis u\u017e k\u016bno pakilimo auk\u0161t\u012f]].|N_2|Pa\u017eym\u0117jus darb\u0105, reikaling\u0105 kroviniui pakelti vertikaliai \u012f auk\u0161t\u012f h ADFLT[[\u2081]], o darb\u0105, atliekam\u0105 t\u0105 pat\u012f krovin\u012f pakeliant \u012f t\u0105 pat\u012f auk\u0161t\u012f h nuo\u017eulni\u0105j\u0105 plok\u0161tum\u0105 A\u2082, gauname lygyb\u0119 Ph=Fl, arba santyk\u012f P/F = l/h.|N_4|ITAL[[Nuo\u017eulniosios plok\u0161tumos naudojamos siekiant lengviau pakelti sunkius daiktus ir pan.]]\nITAL[[Pvz.: sunk\u016bs daiktai \u012f sunkve\u017eim\u012f \u012fridenami storomis lentomis, o ne keliami tiesiai auk\u0161tyn, \u012f stat\u0173 kaln\u0105 lipame vingiais, o ne tiesiausiu keliu.]]",!1,16,null)
B.b6C=new A.bs("Susisiekian\u010di\u0173j\u0173 ind\u0173 principas pla\u010diai taikomas buityje ir technikoje: laistytuvai, kavinukai bei arbatinukai gaminami su snapeliais; su dideliu vandens rezervuaru sujung\u0119 stiklin\u012f vamzdel\u012f, galime kontroliuoti vandens lyg\u012f; kanalizacijos sistemoje susisiekiantieji indai (i\u0161lenkta ir vandens pripildyta vamzd\u017eio dalis) trukdo smarvei patekti \u012f kambar\u012f ITAL[[(paveiksl\u0117lyje)]]. \u0160iuo principu pagr\u012fstas \u0161liuz\u0173 ir vandentiekio veikimas.",!1,16,null)
B.b6D=new A.bs("BOLD[[Elektros grandin\u0117 apskai\u010diuota tam tikram did\u017eiausiam srov\u0117s stipriui.]] CBLU[[Jeigu ja pradeda tek\u0117ti stipresn\u0117 u\u017e leid\u017eiam\u0105j\u0105 srov\u0117, jungiamieji laidai gali labai smarkiai \u012fkaisti ir u\u017esidegti.]]|N_2|Srov\u0117s stipris grandin\u0117je gali padid\u0117ti, kai susilie\u010dia neizoliuoti jos laidai, kai grandin\u0117 taisoma nei\u0161jungta i\u0161 tinklo, kai \u012f j\u0105 \u012fjungiami ma\u017eos var\u017eos imtuvai arba \u012f grandin\u0119 \u012fjungus imtuvus, kuriems maitinti reikia stipresn\u0117s srov\u0117s (perkrovus grandin\u0119). BOLD[[Visais \u0161iais atvejais \u012fvyksta trumpasis jungimas.]]|N_2|BOLD[[Norint to i\u0161vengti \u012f tinkl\u0105 \u012fjungiami saugikliai.]] Jie automati\u0161kai i\u0161jungia elektros grandin\u0119 kai srov\u0117s stipris joje pasidaro didesnis u\u017e leid\u017eiam\u0105j\u012f.",!1,16,null)
B.b6F=new A.bs("BOLD[[Garo turbin\u0105 sudaro ant veleno u\u017emautas diskas (1) su mentel\u0117mis (2).]]|N_1|Tarp \u0161i\u0173 menteli\u0173 \u012ftaisyti kreipra\u010diai su nejudamomis ment\u0117mis. Jos nukreipia i\u0161 katilo i\u0161siver\u017eian\u010dius garus \u012f disko menteles. Sl\u0117gdami jas, garai greitai suka disk\u0105. Turbina sukasi.|N_2|CBLU[[\u0160iuolaikin\u0117se turbinose ant vieno veleno u\u017emaunama keletas toki\u0173 disk\u0173.]] Garai i\u0161 eil\u0117s pereina pro vis\u0173 j\u0173 menteles.",!1,16,null)
B.b6G=new A.bs("Lempinis generatorius - vienas pagrindini\u0173 nagrin\u0117siam\u0173 elektromagnetini\u0173 virpesi\u0173 generatori\u0173.",!1,16,null)
B.b6H=new A.bs("BOLD[[Aplink\u0105 labiausiai ter\u0161ia automobili\u0173 i\u0161metamos dujos, kuriose yra \u0161vino.]]",!1,16,null)
B.b6I=new A.bs("CBLU[[Nejudan\u010diame laidininke elektronus priver\u010dia jud\u0117ti]] (ir taip atsiranda elektros srov\u0117 - nes yra judantys kr\u016bvininkai - elektronai) CBLU[[elektrinis laukas]] (vadinamas BOLD[[s\u016bkuriniu elektriniu lauku]]), CBLU[[kuris atsiranda d\u0117l kintan\u010dio magnetinio lauko.]]\nBOLD[[S\u016bkurinio elektrinio lauko j\u0117g\u0173 linijos yra u\u017edaros.]]",!1,16,null)
B.b6J=new A.bs("Vienet\u0173 su SI sistemos prie\u0161d\u0117liais vertimas ir kaitymas BOLD[[n\u0117ra sud\u0117tingas procesas]]. Tereikia BOLD[[atsiminti ar tur\u0117ti t\u0173 prie\u0161d\u0117li\u0173 reik\u0161mes]] ir XBLD[[\u017einoti]], XBLD[[kada]] turim\u0105 reik\u0161m\u0119 XBLD[[dauginti]], o XBLD[[kada dalinti]] i\u0161 prie\u0161d\u0117lio reik\u0161m\u0117s.",!1,16,null)
B.b6K=new A.bs("Tam, kad rastume magnetinio lauko j\u0117g\u0173 linij\u0173 krypt\u012f, mes jau turime \u017einoti (turi b\u016bti duotos) to u\u017edaro laidininko elektros srov\u0117s kryptis.\nV\u0117l taikome XBLD[[Lenco taisykl\u0119]]: \u0161\u012f kart\u0105 de\u0161ine ranka apimame \u017eied\u0105 taip, kad keturi sulenkti pir\u0161tai b\u016bt\u0173 nukreipti srov\u0117s kryptimi (lygiai taip, kaip jie parod\u0117 srov\u0117s krypt\u012f j\u0105 nustatant pagal magnetines linijas).\nTada i\u0161tiestas nyk\u0161tys rodys magnetinio lauko j\u0117g\u0173 linij\u0173 krypt\u012f.",!1,16,null)
B.b6L=new A.bs("BOLD[[\u0160\u012f metod\u0105 geriausia paai\u0161kinti prakti\u0161kai - per konkre\u010dius pavyzd\u017eius.]] Ta\u010diau jo esm\u0117 labai paprasta j\u012f perpratus:|N_2|CBLU[[Sukuriame toki\u0105 trupmen\u0105, kad jos reik\u0161m\u0117 b\u016bt\u0173 lygi 1, o j\u0105 padauginus su norimu konvertuoti vienetu, vienas i\u0161 j\u0173 i\u0161siprastint\u0173, o atsirast\u0173 kitas, kurio norime]] ITAL[[(prisiminkite, jog dauginant dyd\u012f ar skai\u010di\u0173 i\u0161 1 jo reik\u0161m\u0117 nekinta)]]",!1,16,null)
B.b6M=new A.bs("XBLD[[J\u0117gos moment\u0173 taisykl\u0117 teigia]], jog j\u0117g\u0173 moment\u0173, sukan\u010di\u0173 k\u016bn\u0105 laikrod\u017eio rodykl\u0117s jud\u0117jimo kryptimi, suma yra lygi j\u0117g\u0173 moment\u0173, sukan\u010di\u0173 j\u012f prie\u0161inga kryptimi, sumai.",!1,16,null)
B.b6O=new A.bs("Vidaus degimo varikliai, garo turbinos ir kiti \u0161iluminiai varikliai tik dal\u012f kuro i\u0161skiriamos energijos paver\u010dia mechaniniu darbu. I\u0161 variklio i\u0161\u0117j\u0119 garai ar dujos dar turi energijos. CBLU[[Juo didesn\u0117 vidin\u0117s kuro energijos dalis \u0161iluminiame variklyje paver\u010diama naudinguoju darbu, juo ekonomi\u0161kesnis variklis \u2014 didesnis jo naudingumo koeficientas.]]|N_2|BOLD[[Naudingasis darbas A]]DFLT[[\u2099]]BOLD[[ visada ma\u017eesnis u\u017e vidin\u0119 kuro energij\u0105 Q : A]]DFLT[[\u2099]]BOLD[[ < Q]].|N_1|CBLU[[Naudingumo koeficientas gali b\u016bti i\u0161reik\u0161tas skai\u010diumi (0 < \u03b7 < 1) arba procentais (0% < \u03b7 < 100%).]]",!1,16,null)
B.b6P=new A.bs("Archimedo j\u0117g\u0105, veikian\u010di\u0105 tam tikr\u0105 k\u016bn\u0105 skystyje galima i\u0161matuoti ir naudojant dinamometr\u0105 (prietais\u0105, skirt\u0105 apskai\u010diuoti j\u0117gai). Dinamometru i\u0161matuokite to k\u016bno svor\u012f ore ir tada jo svor\u012f vandenyje. Svorio ore ir vandenyje skirtumas lygu Archimedo j\u0117gai (FDFLT[[\u2090]] = PDFLT[[\u2092]] - PDFLT[[\u209b\u2096]] ).",!0,13,null)
B.b6R=new A.bs("ELektrini\u0173 pagaminama elektra yra perduodama dideliais atstumais, kas yra nuostolinga, nes tek\u0117dama laidais elektra juos \u0161ildo ir taip prarandama energija ITAL[[(prisiminkite, jog LTXT[[Q=I^2Rt]] - taigi, kuo didesnis stipris arba var\u017ea, tuo didesni nuostoliai)]].\nNuostolius galima suma\u017einti suma\u017einant laid\u0173 var\u017e\u0105 arba srov\u0117s stipr\u012f. Suma\u017einti laid\u0173 var\u017e\u0105 prakti\u0161kai ne\u012fmanoma, nes tam reik\u0117t\u0173 itin stor\u0173 laid\u0173 LTXT[[(R=\\rho \\frac{l}{S})]], taigi BOLD[[reikia suma\u017einti srov\u0117s stipr\u012f]]. Tam, kad nepakist\u0173 perduodama galia, reikia BOLD[[didinti \u012ftamp\u0105]]. Tam naudojami auk\u0161tinamieji transformatoriai, o kai elektra pasiekia vartotojus - \u017eeminamieji (suma\u017einama \u012ftampa iki naudojamos, da\u017eniausiai 220V).",!1,16,null)
B.b6S=new A.bs("Paveiksl\u0117lyje pavaizduota, kokios j\u0117gos veikia skystyje panardint\u0105 k\u016bn\u0105. I\u0161 \u0161on\u0173 ta\u0161el\u012f veikia j\u0117gos, kurios yra vienodo didumo, bet prie\u0161ing\u0173 kryp\u010di\u0173. Jos atsveria viena kit\u0105. Vir\u0161utin\u0119 ta\u0161elio dal\u012f skys\u010dio stulpelis hDFLT[[\u2081]] veikia j\u0117ga FDFLT[[\u2081]], apatin\u0119 \u2014 stulpelis h\u2082 j\u0117ga F\u2082. Kadangi h\u2082 > hDFLT[[\u2081]] tai ir F\u2082 > FDFLT[[\u2081]]. J\u0117g\u0173 FDFLT[[\u2081]] ir F\u2082 atstojamoji ir yra Archimedo j\u0117ga FDFLT[[\u2090]]  = F\u2082 - FDFLT[[\u2081]]. Ji nukreipta \u012f didesniosios j\u0117gos pus\u0119 (auk\u0161tyn).|N_4|BOLD[[Kitaip tariant:]] sl\u0117gis \u017eemiau k\u016bno yra didesnis negu auk\u0161\u010diau k\u016bno (nes skys\u010diai sl\u0117g\u012f perduoda \u012f visas puses vienodai), tod\u0117l jis vandens stumiamas \u012f vir\u0161\u0173 didesne j\u0117ga nei \u012f apa\u010di\u0105. CBLU[[Tas j\u0117g\u0173 skirtumas ir yra Archimedo j\u0117ga.]]|N_4|",!1,16,null)
B.b6U=new A.bs("Skys\u010dio molekul\u0117s nuolat juda \u012fvairiu grei\u010diu. Grei\u010diausios, atsid\u016brusios skys\u010dio pavir\u0161iuje, \u012fveikia kit\u0173 molekuli\u0173 trauk\u0105 ir i\u0161lekia i\u0161 jo \u012f or\u0105 nematomais garais. Taip i\u0161 atviro indo skystis pama\u017eu i\u0161garuoja.|N_1|BOLD[[Garavimas vyksta bet kokioje temperat\u016broje, tik med\u017eiagos pavir\u0161iuje.]]|N_6|BOLD[[Virimas vyksta tik skys\u010dio virimo temperat\u016broje, ta\u010diau visame skys\u010dio t\u016bryje.]]|N_1|CBLU[[Virimo temperat\u016bra priklauso nuo sl\u0117gio - dideliame sl\u0117gyje auk\u0161tesn\u0117 virimo temperat\u016bra, ma\u017eesniame sl\u0117gyje - \u017eemesn\u0117.]]",!1,16,null)
B.b6V=new A.bs("Voltmetras \u012f elektrin\u0119 grandin\u0119 XBLD[[jungiamas lygiagre\u010diai]] tam prietaisui, kurio \u012ftampa matuojama.",!1,16,null)
B.b6W=new A.bs("BOLD[[Bet kurios formos susisiekian\u010diuosiuose induose nejudan\u010dio vienaly\u010dio skys\u010dio lygis yra vienodas.]]|N_4|\u017dinome, kad skys\u010dio stulpelio sl\u0117gis priklauso nuo stulpelio auk\u0161\u010dio. Kadangi vienodas stulpeli\u0173 auk\u0161tis, tod\u0117l vienodas abiejuose stulpeliuose ir sl\u0117gis.",!1,16,null)
B.b6X=new A.bs("Paversti i\u0161vestinius dyd\u017ei\u0173 vienetus, sudarytus i\u0161 keli\u0173 pagrindini\u0173 vienet\u0173 \u012f kitus arba bet kokius kitus vienetus BOLD[[yra \u0161iek tiek sud\u0117tingiau]], BOLD[[ta\u010diau i\u0161mokus]] apie toliau kalbam\u0105 metod\u0105 - BOLD[[gana paprasta]].|N_4|XBLD[[Svarbiausia yra mok\u0117ti t\u0173 dyd\u017ei\u0173 vertimo reik\u0161mes]] ITAL[[(t.y. kiek viename dydyje yra kit\u0173)]].|N_4|CBLU[[\u0160iuo b\u016bdu galima taip pat paversti ir vienetus su SI sistemos prie\u0161d\u0117liais \u012f kitus]], ta\u010diau prie\u0161 \u0161it\u0105 esan\u010diame puslapyje minimas metodas yra paprastesnis ir greitesnis.",!1,16,null)
B.b6Y=new A.bs('Formuli\u0173 i\u0161rei\u0161kimas algebriniu b\u016bdu patartinas tiems, kas nori mok\u0117ti i\u0161rei\u0161kti bet kokias formules universaliu, pla\u010diausiai naudojamu b\u016bdu. BOLD[[Nors jis gali pasirodyti gana sud\u0117tingas i\u0161 prad\u017ei\u0173, greitai supratus \u0161io b\u016bdo esm\u0119 jis tampa paprastu.]]|N_4|\u0160is b\u016bdas, kitaip nei "trikampis", XBLD[[tinka visoms formul\u0117ms]], nesvarbu i\u0161 kiek kintam\u0173j\u0173 ar matematini\u0173 \u017eenkl\u0173 jos sudarytos. XBLD[[Tai vienintelis b\u016bdas i\u0161reik\u0161ti ne\u017einom\u0105j\u012f i\u0161 dviej\u0173 ar daugiau sulygint\u0173 lyg\u010di\u0173.]]',!1,16,null)
B.b6Z=new A.bs("Kaip matome i\u0161 formuli\u0173, virpesi\u0173 kont\u016bre vykstan\u010di\u0173 elektromagnetini\u0173 virpesi\u0173 periodas (taigi ir da\u017enis) priklauso nuo kondensatoriaus talpos bei rit\u0117s induktyvumo.",!1,16,null)
B.b7_=new A.bs('Formuli\u0173 i\u0161sirei\u0161kimas "trikampiu" XBLD[[patartinas tiems, kas nori paprastas, trij\u0173 dyd\u017ei\u0173 formules i\u0161sireik\u0161ti paprastai ir greitai, daug negalvojant ir nesprend\u017eiant laiko pertvarkymams]].|N_4|Ta\u010diau, \u0161is b\u016bdas netinka visoms formul\u0117ms i\u0161sireik\u0161ti. Juo galima naudotis BOLD[[tik turint vien\u0105 formul\u0119, sudaryt\u0105 i\u0161 trij\u0173 ar keturi\u0173 ne\u017einom\u0173j\u0173, kuri\u0173 tik vienas t\u0117ra trupmenos skaitiklyje]] (arba kitaip tariant, tik pa\u010dioms papras\u010diausioms formul\u0117ms).',!1,16,null)
B.b72=new A.bs("Jei kintamosios srov\u0117s stiprio kitim\u0105 pavaizduosime grafi\u0161kai, pamatysime, jog \u0161i pakyla ir pasiekia did\u017eiausi\u0105 vert\u0119 pirmajame periodo ketvirtyje. \u0160is, did\u017eiausias srov\u0117s stipris, vadinamas BOLD[[amplitudine verte]] arba BOLD[[amplitude]] ir \u017eymimas BOLD[[ISUBB[[m]]]].|N_4|Kintamoji srov\u0117, kaip ir nuolatin\u0117, tek\u0117dama \u0161ildo laidinink\u0105 (prisiminkite formul\u0119 LTXT[[Q=I^2 R t]]) nepriklausomai nuo jos tek\u0117jimo krypties. Taigi, kai ITAL[[kintamoji srov\u0117 i\u0161skiria tiek pat \u0161ilumos kaip ir nuolatin\u0117 srov\u0117, tokia nuolatin\u0117s srov\u0117s stiprio vert\u0117 vadinama BOLD[[efektine verte]]]].",!1,16,null)
B.b73=new A.bs("XBLD[[Saviindukcijos rei\u0161kinys]] teigia, jog BOLD[[jei grandin\u0117je teka kintanti elektros srov\u0117, joje taip pat atsiranda indukuotoji elektrovara]].",!1,16,null)
B.b74=new A.bs("XBLD[[Praktinis b\u016bdas:]]",!0,16,null)
B.b75=new A.bs("BOLD[[Kintamoji elektros srov\u0117]] - elektros srov\u0117, kurios stipris ir kryptis periodi\u0161kai kinta.\nELektrin\u0117se schemose ir ant prietais\u0173 ji \u017eymima ~ simboliu.|N_4|",!1,16,null)
B.b77=new A.bs("\u017demesnis skys\u010dio stulpelis (jo auk\u0161tis h2) atsveria auk\u0161tesn\u012f stulpel\u012f (h1).|N_2|Vadinasi, t\u0173 stulpeli\u0173 sl\u0117gis yra vienodas: \u03c1DFLT[[\u2081]]hDFLT[[\u2081]] = \u03c1\u2082h\u2082. I\u0161 \u0161ios formul\u0117s gauname, jog \u03c1DFLT[[\u2081]]/\u03c1\u2082 = h\u2082/hDFLT[[\u2081]].|N_4|BOLD[[Susisiekian\u010diuosiuose induose skirting\u0173 skys\u010di\u0173 stulpeli\u0173 auk\u0161tis yra atvirk\u0161\u010diai proporcingas t\u0173 skys\u010di\u0173 tankiams.]]",!1,16,null)
B.b7b=new A.bs("BOLD[[Daugelio lydom\u0173 k\u016bn\u0173 t\u016bris did\u0117ja, o kiet\u0117jan\u010di\u0173 \u2014 ma\u017e\u0117ja. I\u0161imtis yra vanduo.]]|N_2|CBLU[[Su\u0161alusio \u012f led\u0105 vandens t\u016bris padid\u0117ja apie 10%.]] CBLU[[Ledo tankis ma\u017eesnis negu vandens]], tod\u0117l jo lytys ne sk\u0119sta, o pl\u016bduriuoja vandens pavir\u0161iuje.",!1,16,null)
B.b7d=new A.bs("Indukuotosios srov\u0117s stipris yra tiesiogiai proporcingas magnetinio srauto kitimo grei\u010diui:|N_2|",!1,16,null)
B.b7e=new A.bs("Abi \u0161ios j\u0117gos da\u017eniausiai veikia kartu, ta\u010diau j\u0173 veikimo ta\u0161kai yra skirtingi, taigi ir k\u016bnai, kuriuos jos veikia.\nSunkio j\u0117ga veikia BOLD[[pat\u012f k\u016bn\u0105]], o svoris - BOLD[[pakab\u0105 arba atram\u0105]], kuri\u0105 k\u016bnas tempia arba spaud\u017eia.",!1,16,null)
B.b7f=new A.bs("BOLD[[Garsas gali sklisti ne tik oru, bet ir kietaisiais k\u016bnais bei skys\u010diais.]] Nuo to, kuria tepre garsas sklinda, priklauso ir jo greitis ITAL[[(1 lentel\u0117)]]. Taip pat jis kinta ir nuo terp\u0117s temperat\u016bros, pavyzd\u017eiui, kylant temperat\u016brai, garso greitis did\u0117ja ITAL[[(2 lentel\u0117)]].\nBOLD[[Tuo tarpu vakuume jis nesklinda]], nes garsas t\u0117ra mechanin\u0117 banga, kuri pagal apibr\u0117\u017eim\u0105 - daleli\u0173 jud\u0117jimas (daleli\u0173 vakuume n\u0117ra).",!1,16,null)
B.b7g=new A.bs("BOLD[[Gars\u0105 sukelia virpantys (16Hz - 20000Hz) k\u016bnai.]] Jie tai suspaud\u017eia, tai i\u0161retina greta esant\u012f or\u0105 - taip susidaro i\u0161ilgin\u0117 garso banga, kuri nuo garso \u0161altinio (virpan\u010dio k\u016bno) sklinda \u012f visas puses. Virpantis oras (t. y. garso banga), pasiek\u0119s \u017emogaus aus\u012f, veikia klausos organ\u0105, i\u0161 ten neuronais signalas nukeliav\u0119s \u012f smegenis suvokiamas kaip garsas.",!1,16,null)
